// -------------------- Import --------------------
import React, { Component } from "react";
import { NavLink } from "react-router-dom";
import nba_logo from "../../Assets/Icons/nba_logo.png";

// -------------------- Main Bar --------------------
export default class MainBar extends Component {
  render() {
    return (
      <header className="main_bar">
        <div>
          {/* Logo */}
          <img src={nba_logo} alt="" className="nba_logo" />
          <div>LOGO</div>
          {/* Title */}
          <h1>NBA</h1>
          {/* Players */}
          <NavLink to="/Players">
            <span>Players</span>
          </NavLink>
          {/* Teams */}
          <NavLink to="/Teams">
            <span>Teams</span>
          </NavLink>
        </div>
      </header>
    );
  }
}
